  false,\n\t\"url\": null,\n\t\"notes\": \"This Light Detection and Ranging (LiDAR)
  bare-earth classified LAS dataset is a topographic survey conducted for the USACE
  USVI LiDAR Project. These data were produced for The Corps of Engineers Jacksonville
  District. The USVI LiDAR Survey consists of the islands of St. Croix, St. Thomas,
  and St. John. The LiDAR point cloud was flown at a density sufficient to support
  the Federal Emergency Management Agency (FEMA) guidelines and specifications. The
  Atlantic Group acquired the USVI LiDAR Survey between November 16, 2007 and November
  29, 2007. The USVI LiDAR survey was collected under the guidance of a Professional
  Mapper/Surveyor.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
